import React from 'react';

import './App.css';


function App() {
  return (
    <div className="App"> 
     <form action='/api/items' method='post'> 
        <div>
            <input type="text" name="item" placeholder='Enter Your Todos..'/>
            <button type='submit' className='Submit-btn'><i className="fa fa-plus-square"></i></button>
        </div>       
     </form>
    </div>
  );
}

export default App;
